description:
Als Janek Mattias Mitter 's ochtend wakker wordt, vind hij de badkamer op slot. Het is stil daarbnnen. Ongerust breekt hij de deur open en vindt zijn vrouw in bad, verdronken. Aan commissaris Van Veeteren verklaart Mitter dat hij zich niets van de voorafgaande nacht kan herinneren. Mitter wordt schuldig bevonden aan moord en opgesloten in een psychiatrisch gevangenis. Dan valt er een tweede dode.  



